Accounts_CustomFields_Description:
应该是有效的JSON，其中键是包含字段设置字典的字段名称。例如：<br/><code>{
“角色”：{
“type”：“select”，
“defaultValue”：“学生”，
“选项”：[“老师”，“学生”]，
“required”：是的，
“modifyRecordField”：{
“数组”：是的，
“字段”：“角色”
}
}，
“推特”： {
“type”：“text”，
“required”：是的，
“minLength”：2，
“maxLength”：10
}
}</code>

Custom_Translations_Description:
应该是有效的JSON，其中键是包含键和翻译字典的语言。例如：<br/><code>{
“en”：{
“频道”：“房间”
}，
“pt”：{
“频道”：“萨拉斯”
}
}</code>
